import React from 'react';
import { Link } from 'react-router-dom';
import './home.scss';
import { useEffect } from 'react';


const Home = () => {
    useEffect(() => {
        const options = {
            root: null,
            rootMargin: '0px',
            threshold: 0.1
        }

        const handleIntersect = (entries, observer) => {
            entries.forEach(entry => {
                if (entry.isIntersecting) {
                    console.log('handleIntersect: Element is intersecting');
                    // Faites ce que vous devez faire lorsque l'élément est visible
                }
            });
        }

        const observer = new IntersectionObserver(handleIntersect, options);
        const elementToObserve = document.querySelector('.reveal');
        if (elementToObserve) {
            observer.observe(elementToObserve);
        }

        // Nettoyez l'observateur lorsque le composant est démonté
        return () => {
            if (elementToObserve) {
                observer.unobserve(elementToObserve);
            }
        }
    }, []);
    return (
        <div>
            <h2>Nos services</h2>
            <hr></hr>
            <div className='logo reveal'>
            <img src='/images/Pulse.png'/>
            <img src='/images/Dumbbell.png'/>
            <img src='/images/Pilates.png'/>
            </div>
            <div className='service'>
            <p>Cardio</p>
            <p>Musculation</p>
            <p>Pilates</p>
            </div>
            <div className='logos'>
            <img src='/images/eat.png'/>
            <img src='/images/Guru.png'/>
            </div>
            <div className='services'>
            <p>Nutrition</p>
            <p>Yoga</p>
            </div>
            <hr></hr>

            <h2>Avis</h2>
            <div className='avis'>
            <div className='avis-un'>
                <img src='/images/avis.png'/>
                <div className='duree'>
                <p>Il y a un mois</p>
                </div>
                <p>Lorem ipsum dolor sit amet consectetur. Pellentesque cursus urna pellentesque et dui at. Natoque cras dignissim venenatis proin mi quis. A ut quam tellus viverra eu maecenas sit diam. Tortor nulla sed faucibus montes ullamcorper. Pulvinar ullamcorper adipiscing lectus faucibus dictum tempor. Justo habitasse non eu tristique augue. Luctus viverra condimentum diam et nunc lacus convallis. Pellentesque ipsum id eleifend mattis amet. Habitasse proin egestas nam turpis tempus eget. </p>
                <div className='nom'>
                    <p>• Stella N</p>
                </div>
            </div>
            <div className='avis-deux'>
                <img src='/images/avis.png'/>
                <div className='duree'>
                <p>Il y a un mois</p>
                </div>
                <p>Lorem ipsum dolor sit amet consectetur. Pellentesque cursus urna pellentesque et dui at. Natoque cras dignissim venenatis proin mi quis. A ut quam tellus viverra eu maecenas sit diam. Tortor nulla sed faucibus montes ullamcorper. Pulvinar ullamcorper adipiscing lectus faucibus dictum tempor. Justo habitasse non eu tristique augue. Luctus viverra condimentum diam et nunc lacus convallis. Pellentesque ipsum id eleifend mattis amet. Habitasse proin egestas nam turpis tempus eget. </p>
                <div className='nom'>
                    <p>• Melissa b</p>
                </div>
            </div>
            <div className='avis-trois'>
                <img src='/images/avis.png'/>
                <div className='duree'>
                <p>Il y a un mois</p>
                </div>
                <p>Lorem ipsum dolor sit amet consectetur. Pellentesque cursus urna pellentesque et dui at. Natoque cras dignissim venenatis proin mi quis. A ut quam tellus viverra eu maecenas sit diam. Tortor nulla sed faucibus montes ullamcorper. Pulvinar ullamcorper adipiscing lectus faucibus dictum tempor. Justo habitasse non eu tristique augue. Luctus viverra condimentum diam et nunc lacus convallis. Pellentesque ipsum id eleifend mattis amet. Habitasse proin egestas nam turpis tempus eget. </p>
                <div className='nom'>
                    <p>• Francois F</p>
                </div>
            </div>
            </div>
            <div className='bouton'>
                <Link to= '/Avis'><button>Redigez un avis</button></Link>
            </div>
        </div>
    )
}

export default Home;
